import Phrase from './Phrase';
import styled from 'styled-components';
import { mediaQuery } from '../utils/style';

const layoutStyle = {
  padding: 20,
  border: '1px solid #DDD',
  height: 150,
};

const PhraseLayout = props => (
  <div>
    <div style={layoutStyle}>
      <Phrase />
      {props.children}
    </div>
  </div>
);

export default PhraseLayout;
